-- Ejemplo de Ejecucion:
        EXEC [SONDA].[SWIFT_SP_UPDATE_DISTRIBUTION_CENTER]
			@DISTRIBUTION_CENTER_ID = 1
			,@NAME_DISTRIBUTION_CENTER = 'Centro de Distribución Sur'
			,@DESCRIPTION_DISTRIBUTION_CENTER = 'Centro de Distribución Sur'
			,@LOGO_IMG = 'data:image/png;base64,'
			,@LOGIN = 'GERENTE@SONDA'
			,@ADDRESS_DISTRIBUTION_CENTER = 'Guatemala'
			,@LATITUDE = 14.64072
			,@LONGITUDE = -90.51327
		--
		SELECT * FROM [SONDA].[SWIFT_DISTRIBUTION_CENTER]
*/
-- =============================================
CREATE PROCEDURE [SONDA].[SWIFT_SP_UPDATE_DISTRIBUTION_CENTER] (
	@DISTRIBUTION_CENTER_ID INT
	,@NAME_DISTRIBUTION_CENTER VARCHAR(250)
	,@DESCRIPTION_DISTRIBUTION_CENTER VARCHAR(250)
	,@LOGO_IMG VARCHAR(MAX)
	,@LOGIN VARCHAR(50)
	,@ADDRESS_DISTRIBUTION_CENTER VARCHAR(250)
	,@LATITUDE NUMERIC(18,8)
	,@LONGITUDE NUMERIC(18,8)
)
AS
BEGIN
	BEGIN TRY
		SET NOCOUNT ON;
		--
		UPDATE [SONDA].[SWIFT_DISTRIBUTION_CENTER]
		SET
			[NAME_DISTRIBUTION_CENTER] = @NAME_DISTRIBUTION_CENTER
			,[DESCRIPTION_DISTRIBUTION_CENTER] = @DESCRIPTION_DISTRIBUTION_CENTER
			,[LOGO_IMG] = @LOGO_IMG
			,[LAST_UPDATE_BY] = @LOGIN
			,[LAST_UPDATE_DATETIME] = GETDATE()
			,[ADRESS_DISTRIBUTION_CENTER] = @ADDRESS_DISTRIBUTION_CENTER
			,[LATITUDE] = @LATITUDE
			,[LONGITUDE] = @LONGITUDE
		WHERE [DISTRIBUTION_CENTER_ID] = @DISTRIBUTION_CENTER_ID
		--
		IF @@error = 0 
		BEGIN		
			SELECT  1 as Resultado , 'Proceso Exitoso' Mensaje ,  0 Codigo, '0' DbData
		END		
		ELSE BEGIN		
			SELECT  -1 as Resultado , ERROR_MESSAGE() Mensaje ,  @@ERROR Codigo
		END
	END TRY
	BEGIN CATCH     
		 SELECT  -1 as Resultado
		,CASE CAST(@@ERROR AS VARCHAR)
			WHEN '2627' THEN 'Ya existe un Centro de Distribucion con el mismo Nombre'
			ELSE ERROR_MESSAGE() 
		END Mensaje 
		,@@ERROR Codigo
	END CATCH
END
